import React from 'react';

const SearchResultsList = (props) => {
    return ( 

                             <ul>           
                                {props.videoSearchResults.map(function(video){
                                return 
                                    <li><img src={props.video.snippet.thumbnails.medium.url} alt=""/></li>

                                })}
                            </ul>

     );
}

export default SearchResultsList;
